import React from "react";

class OneMessage extends React.Component {
    render(){
        return(
            <>
                    <div className="row">
                    <div id={this.props.id} className="container card border-success mb-3 w-50 col-11"  >
                            <div className="card-header">
                                {this.props.createdAt}
                            </div>
                            <div className="card-body">
                                <h4 className="card-title">{this.props.auteur}</h4>
                                <p className="card-text">{this.props.message}</p>
                            </div>
                        </div>
                        <button type="button" className="btn btn-primary col-1 h-25 ">X</button>
                    </div>


            </>
        )
    }
}

export default OneMessage
